import logo from "./logo.svg";
import { YoutubeData } from "./data";
import "./App.css";
import YoutubeItem from "./components/youtube/YoutubeItem";

/**
 * element = <div id = "root"> hello world</div>
 * element = React.createElement("div", {id: 'root'}, 'Hello world');
 *
 */
console.log(YoutubeData);
function App() {
  return (
    <div>
      <div className="youtube-list">
        {YoutubeData.map((item, index) => {
          let newClass = "";
          if (index === 1) newClass = "abc";
          return (
            <YoutubeItem
              key={item.id}
              image={item.image}
              avatar={item.avatar || item.image}
              title={item.title}
              author={item.author}
              className={newClass}
            ></YoutubeItem>
          );
        })}
      </div>
    </div>
  );
}

export default App;
